```
#include <iostream>

class ArrayHandler {
private:
    int* arr; // pointer to the allocated array
public:
    // constructor to initialize the pointer to nullptr
    ArrayHandler() : arr(nullptr) {}

    // method to allocate an array dynamically
    void allocateArray(int size) {
        // check if the array is already allocated and deallocated
        if (arr != nullptr) {
            std::cout << "The array has already been allocated and filled.\n";
            return;
        }

        // allocate memory for the array
        arr = new int[size];
    }

    // method to fill the array with numbers
    void fillArray(int size) {
        // check if the array is already allocated and deallocated
        if (arr == nullptr) {
            std::cout << "The array has not been allocated yet.\n";
            return;
        }

        // fill the array with numbers
        for (int i = 0; i < size; i++) {
            arr[i] = i + 1;
        }
    }

    // method to deallocate the memory of the array
    void deallocateArray() {
        // check if the array is already allocated and deallocated
        if (arr == nullptr) {
            std::cout << "The array has not been allocated yet.\n";
            return;
        }

        // deallocate the memory of the array
        delete[] arr;
        arr = nullptr;
    }
};

int main() {
    ArrayHandler handler;

    // allocate an array dynamically
    handler.allocateArray(10);

    // fill the array with numbers
    handler.fillArray(10);

    // print the values of the array
    for (int i = 0; i < 10; i++) {
        std::cout << "arr[" << i << "] = " << arr[i] << "\n";
    }

    // deallocate the memory of the array
    handler.deallocateArray();

    return 0;
}
```
This program demonstrates how to use dynamic memory allocation and deallocation using pointers in C++. It creates a class named `ArrayHandler` with methods to allocate an array dynamically, fill it with numbers, and then deallocate the memory properly. The main function allocates an array of size 10, fills it with numbers, prints the values of the array, and then deallocates the memory using the `deallocateArray()` method.

