 Sure, here's a comparison of how inheritance works in Java and Python:

Java:
In Java, inheritance is implemented using the concept of "extends". This means that a class can be declared as an "extends" keyword. The class being extended must have a common ancestor class with the same name. For example:

```java
public abstract class Animal {
 public void eat() {
 System.out.println("This animal is eating");
 }
}

public class Dog extends Animal {
 public void bark() {
 System.out.println("Woof!");
 }
}
```
In this example, the "Dog" class extends the "Animal" class and can override the "eat" method to print a different message.

Python:
In Python, inheritance is implemented using the concept of "attributes". This means that a class can be declared as a "class" keyword. A class can inherit attributes from its parent class by putting them directly in the class statement. For example:

```python
class Dog(Animal):
 def __init__(self, breed):
 self.breed = breed
 super().__init__("Canine")

 def eat(self):
 return "Woof!"
```

In this example, the "Dog" class inherits the attributes "breed" and "parent_class" from the parent class "Animal". The "eat" method is also inherited from the parent class.

