Here's a sample C++ program that demonstrates dynamic memory allocation and deallocation using pointers along with the specified ArrayHandler class:
```cpp
#include <iostream>
using namespace std;
class ArrayHandler {
public:
    int* allocateArray(int size) {
        int* arr = new int[size];
        return arr;
    }

    void fillArray(int* arr, int size, int fillValue) {
        for (int i = 0; i < size; ++i) {
            arr[i] = fillValue;
        }
    }

    void deallocateArray(int* arr) {
        delete[] arr;
        arr = nullptr;
    }
};

int main() {
    ArrayHandler arrayHandler;

    int size = 5;
    int* dynamicArray = arrayHandler.allocateArray(size);

    cout << "Dynamic Array Address: " << dynamicArray << endl;

    int fillValue = 42;
    arrayHandler.fillArray(dynamicArray, size, fillValue);

    for (int i = 0; i < size; ++i) {
        cout << dynamicArray[i] << " ";
    }
    cout << endl;

    arrayHandler.deallocateArray(dynamicArray);

    // Setting the pointer to nullptr after deallocation
    dynamicArray = nullptr;

    return 0;
}
```
