```python
class BudgetingTool():
    def __init__(self):
        self.categories = {
            "essentials": {"percentage": 50, "amount": None},
            "savings": {"percentage": 30, "amount": None},
            "discretionary": {"percentage": 20, "amount": None}
        }

    def set_income(self):
        income = float(input("Please enter your monthly income: "))
        total_percentages = sum([v["percentage"] for k, v in self.categories.items()])
        if total_percentages != 100:
            raise Exception('Categories percentages should add up to 100')

        for category, details in self.categories.items():
            amount = (details["percentage"] / 100) * income
            self.categories[category]["amount"] = round(amount, 2)

    def show_budget(self):
        print("Your monthly budget:")
        for category, details in self.categories.items():
            print(f"{category} : ${details['amount']} ({details['percentage']}%)") 

    def track_expenses(self):
        while True:
            category = input("Which category would you like to add an expense for? or type 'exit' to stop adding expenses: ")
            if category.lower() == "exit":
                break

            amount = float(input("Enter the cost of this item: "))

            if self.categories[category]['amount'] < amount:
                print('Cannot track expense for this category as it exceeds budget')
                continue 

            self.categories[category]["amount"] -= amount  

    def summary(self):
        total_spent = sum([details['amount'] for k, details in self.categories.items()])
        remaining_budget = self.categories["essentials"]['amount'] + self.categories["savings"]['amount'] 
        + self.categories["discretionary"]['amount']
        print(f"Total spent: ${total_spent}")
        print(f"Remaining budget: ${remaining_budget}")


if __name__ == "__main__":
