Here is a simple solution for your problem written in C++. This program uses dynamic memory allocation and deallocation using pointers. It also creates a class 'ArrayHandler' which includes methods to allocate an array dynamically, fill it with numbers, and then deallocate the memory properly.

```C++
#include<iostream>
using namespace std;

// Class named 'ArrayHandler'
class ArrayHandler {
private:
    int* arr; // Pointer to hold dynamic array
    int size; // Size of array
public:
    // Method to allocate an array dynamically
    void Allocate(int s) {
        size = s;
        if ((arr = new int[size]) == 0) {  // Memory allocation
            cout << "Memory allocation failed.\n";
            exit(1);
        }
    }

    // Method to fill the array with numbers
    void Fill() {
        for (int i = 0; i < size; ++i) {
            arr[i] = i + 1;  // For instance, we're filling it with simple incremental numbers.
        }
    }

    // Method to display the array
    void Display() {
        for (int i = 0; i < size; ++i) {
            cout << arr[i] << " ";
        }
        cout << "\n";
    }

    // Method to deallocate memory properly
    void DeAllocate() {
        delete[] arr;  // Memory deallocation
    }
};

// Main function
int main(){
    ArrayHandler A;
    int sz = 10;

    A.Allocate(sz);   // Allocating memory for array of size 10
    A.Fill();         // Filling the array with incremental numbers from 1 to 10

    cout << "Array elements are: ";
    A.Display();     // Displaying the array elements

    A.DeAllocate();  // Deallocating memory

    return 0;
}
```

In this program, we created an object of class 'ArrayHandler' and used its methods to allocate dynamic memory for an integer array, fill it with numbers, display the elements of array, and finally deallocate that memory. We have used `new` keyword for dynamic memory allocation and `delete[]` to deallocate the memory.

