The JavaScript function can be refactored in a more efficient and readable way using built-in functions like `reduce()` or the spread operator (`...`). Here is how you can do it:

Option 1 - Using reduce():
```javascript
function addNumbers(arr) {
    return arr.reduce((sum, num) => sum + num, 0);
}
```
In this refactored function, `reduce()` is used to iterate over the array and accumulate the sum of all numbers in a single line. The second argument (0) is the initial value for the accumulator(sum).

Option 2 - Using Spread Operator:
```javascript
function addNumbers(arr) {
    return [...arr].reduce((a, b) => a + b);
}
```
In this refactored function, spread operator is used to create a copy of the array. This could be useful if you need to keep the original array unchanged for some reason. Then `reduce()` is used to add up all numbers in the copied array.

Both versions have better performance and are more readable than the original version. The difference becomes noticeable only when dealing with large arrays, as this function performs a linear scan over the array, so its complexity is O(n).

Yes, I can certainly compare how inheritance works in Java versus Python. However, please note that this is a simplified comparison and doesn't cover every single detail of these languages. 

1. **Inheritance in Java**
   In Java, all classes are descendants from the Object class by default (except for the Object class itself), but you can use any other superclass as needed, including abstract base classes, interface classes, and your own classes. This means that a class inherits methods and fields from its parent or superclass.

   Here is an example:

```java
public class Animal { // Super Class
    public void eat() {
        System.out.println("Animal eats");
    }
}

public class Dog extends Animal { // Sub Class
    @Override
    public void eat() {
        System.out.println("Dog eats meat");
    }
}
```
   In the above code, Dog is a subclass of Animal (`extends Animal`). The `eat()` method in the Dog class overrides the `eat()` method from its superclass. This is an example of inheritance.

2. **Inheritance in Python**
   In Python, classes also inherit methods and fields from their parent or base class, similar to Java. However, Python doesn't have a formal concept of interfaces, which are common features of object-oriented languages like Java. Also, Python supports multiple inheritances, unlike Java where you can only extend one class.

   Here is an example:

