## Answer (2)

```
function addNumbers(arr) {
  var sum = 0;
  for (var i = 0; i < arr.length; ++i)
    sum += arr[i];
  return sum;
}
```

You could use an ES6 array destructuring to get the length of the array, instead of calling `arr.length`.

```
function addNumbers(arr) {
  var [sum, ...rest] = arr;
  for (let i = 0; i < rest.length; ++i)
    sum += rest[i];
  return sum;
}
```

You could also use `Array.reduce`, which returns the accumulated value of a binary operation applied to every element in an array, starting with the first argument (the accumulator).

```
function addNumbers(arr) {
  var sum = arr.reduce((a, b) => a + b);
  return sum;
}
```

The first one is the most performant though. The third one is more efficient if you only want to operate on the values in an array (as opposed to modifying them), because it avoids allocating space for the copy of the array.

