// Get the dropdown menu container element
const dropdownContainer = document.querySelector('.dropdown-container');

// Create an event listener for click events on the dropdown menu container
dropdownContainer.addEventListener('click', function() {
  // Check if the dropdown is already open
  if (!this.classList.contains('open')) {
    // Add the 'open' class to the container element, which will toggle the dropdown
    this.classList.add('open');
  } else {
    // Remove the 'open' class from the container element, which will close the dropdown
    this.classList.remove('open');
  }
});

// Create event listeners for click events on each dropdown option
const options = document.querySelectorAll('.dropdown-option');

options.forEach(function(option) {
  option.addEventListener('click', function() {
    // Close the current dropdown if it's open
    if (this.parentElement.classList.contains('open')) {
      this.parentElement.classList.remove('open');
    }

    // Toggle the clicked option's parent container's 'open' class, which will either close all dropdowns or open a new one
    const container = this.parentElement;
    container.classList.toggle('open', !container.classList.contains('open')));
  });
});
```

