```cpp
#include <iostream>

// Class for ArrayHandler
class ArrayHandler {
public:
    // Method to allocate an array of given size
    void* allocate(int size) {
        void* ptr = nullptr;
        if (size > 0) {
            // Dynamic memory allocation
            ptr = new char[size];
            if (ptr == nullptr) {
                std::cerr << "Memory allocation failed" << std::endl;
                return nullptr; // Handle error here
            }
        }
        return ptr;
    }

    // Method to fill the allocated array with numbers
    void fill(int size, int num) {
        void* ptr = allocate(size);
        if (ptr == nullptr) {
            std::cerr << "Memory allocation failed for filling" << std::endl;
            return; // Handle error here
        }
        // Copy data to allocated memory
        for (int i = 0; i < size; ++i) {
            ((char*)ptr)[i] = num; // Assign number to array element
        }

        // Deallocate memory once done with it
        deallocate(ptr);
    }

    // Method to deallocate the dynamically allocated array
    void deallocate(void* ptr) {
        if (ptr != nullptr) {
            // Free memory allocated using new
            delete[] ((char*)ptr));
            ptr = nullptr; // Indicate that pointer is no longer valid
        }
    }
};

int main() {
    ArrayHandler ah;

    int size = 10;
    int num = 5;
    ah.allocate(size);
    ah.fill(size, num);
    ah.deallocate(ah.allocate(size))); // Deallocate again (was allocated twice)

    return 0;
}
```

This C++ program demonstrates dynamic memory allocation and deallocation using pointers. The `ArrayHandler` class has methods for allocating an array, filling it with numbers, and deallocating the memory properly.

