function sortStringsAlphabetically(arr) {
  return arr.sort((a, b) => {
    if (a < b) return -1;
    if (a > b) return 1;
    return 0;
  });
}
```
Explanation:

The `sort` method is called on the array of strings `arr`. The callback function provided to `sort` takes two elements of the array as arguments, `a` and `b`, and returns an integer that indicates their relative order.

In this case, the callback function simply compares the two strings alphabetically. If `a` comes before `b` in the alphabet, the function returns -1. If `a` comes after `b` in the alphabet, the function returns 1. If `a` and `b` are the same string, the function returns 0.

The `sort` method then uses this callback function to sort the elements of the array in alphabetical order.

For example, if we call `sortStringsAlphabetically(["hello", "world", "abc"])`, the function will return the sorted array `["abc", "hello", "world"]`.

