Here is a C++ program that demonstrates dynamic memory allocation and deallocation using pointers:

```cpp
#include <iostream>
using namespace std;

class ArrayHandler {
public:
  // Method to dynamically allocate an array of size 'n'
  int* allocateArray(int n) {
    int *arr = new int[n]; // Dynamically allocate memory for the array
    return arr;
  }

  // Method to fill the allocated array with numbers from 1 to 'n'
  void fillArray(int* arr, int n) {
    for (int i = 0; i < n; i++) {
      arr[i] = i + 1; // Fill the array with consecutive numbers starting from 1
    }
  }

  // Method to deallocate the memory previously allocated using 'allocateArray()' method
  void deallocateArray(int* arr) {
    delete[] arr; // Deallocate the memory
  }
};

int main() {
  ArrayHandler array_handler;
  int n = 5; // Size of the dynamic array

  cout << "Allocating and filling an array of size: " << n << endl;
  int *arr = array_handler.allocateArray(n); // Dynamically allocate memory for the array
  array_handler.fillArray(arr, n); // Fill the allocated array with numbers from 1 to 'n'
  for (int i = 0; i < n; i++) {
    cout << arr[i] << " "; // Print the array contents
  }
  cout << endl;

  cout << "Deallocating memory..." << endl;
  array_handler.deallocateArray(arr); // Deallocate the memory previously allocated
  return 0;
}
```

