	public static int goodDaysToRobBank(int[] security, int time) {
        int n = security.length;
        if(n<time+1){
            return 0;
        }
        int cnt=0;
        for(int i=time+1;i<n-time-1;++i){//这里的循环只能从time+1开始，因为需要找到连续的天数大于等于time+1才可以，而不是只有一天
            int count = 0;
			for (int j = i-1; j >= time; --j) {//从左边第一个比当前数小或者相同的数开始遍历
                if(security[j]<=security[i]){//只要有一次不满足这个条件，就直接break
                    count++;
				}else{
					break;
				}
            }
            for (int j = i+1; j <= n-time-1; ++j) {//从右边第一个比当前数小或者相同的数开始遍历
