	// 2674. Create Sorted Array Through Instructions
	public static int createSortedArray(int[] instructions) {
		long ans = 0, modulo = (long)1e9 + 7;
		TreeMap<Integer, Integer> map = new TreeMap<>();//建立一个有序的map
		for(int ins : instructions){
			int left = map.floorKey(ins); //返回小于等于该数的最大的值
			int right = map.ceilingKey(ins);//返回大于等于该数的最小的值
			ans += Math.min(left == null ? 0 : ins - left, right != null ? right - ins : 0) + 1;
			map.put(ins, map.getOrDefault(ins, 0) + 1); //计算插入的次数，不管是左边插入还是右边插入，都是要加上原来在map中的数量
		}
		return (int)(ans % modulo);//注意modulo是long类型，所以结果也必须是long类型
	}
    // 2681. Find the Array Concatenation Value
	public static int arrayValue(List<Integer> nums) {
        long res = 0;
        for (int i=nums.size()-1;i>=0;--i){//从后往前遍历，因为只需要第一个数的最大值和最小值就可以了
            if(nums.get(i)<res){//如果当前数比之前得到的最大值或最小值还小，则这个数不能构成连续数列
                return -1;
			}
			if((res-nums.get(i))%2==0){//如果当前数是偶数，则加上这个数，如果不是则减去这个数
				res += nums.get(i);
			}else{
                res -= nums.get(i);
            }
        }
        return (int)(res/2);
    }

	// 2684. Permutation in String
	public static boolean checkInclusion(String s1, String s2) {
        Map<Character, Integer> map = new HashMap<>();
        for (char c : s1.toCharArray()){
            int count = map.getOrDefault(c, 0);//getOrDefault是Map中的一个方法，如果没有这个key就返回0
			map.put(c, ++count);
		}
        for (int i=0;i<s2.length();++i){//因为要求子串长度和s1相等，所以要从i开始遍历
            if(map.containsKey(s2.charAt(i))){ //如果s2中存在s1中的字符，则进行判断是否可以构成一个子串
                int count = map.getOrDefault(s2.charAt(i), 0);//因为可能出现多个相同的字符，所以要先判断count是否大于0
				map.put(s2.charAt(i), --count); //如果count大于0，则把当前字符对应的数量-1，并更新到map中，否则直接返回false
                if (checkSubstr(map, s2, i+1)){//从i+1开始判断是否可以构成一个子串
                    return true; //只要找到一个可以构成的子串就可以返回true了
				}
                map.put(s2.charAt(i), ++count);//如果不能构成子串，则把当前字符对应的数量+1，并更新到map中
            }
        }
        return false;
    }
	public static boolean checkSubstr(Map<Character, Integer> map, String s2, int i){//判断s2中i开始的子串是否可以构成一个子串
        for (char c : s2.substring(i).toCharArray()){
            if(map.containsKey(c)){ //如果s2中还存在s1中的字符，则判断当前字符对应的数量是否大于0，如果不大于0，则直接返回false
                int count = map.getOrDefault(c, 0);//如果有这个key，则返回count+1，如果没有这个key，则返回1，并更新到map中
				if(--count<0){
                    return false;
              	}else{
                    map.put(c, count);//因为可能出现多个相同的字符，所以要先判断count是否大于0
                }
            }
        }
        return true; //如果没有找到s1中的字符，则返回true，因为s2中已经没有s1中的字符了
    }
}

