### Task #2:

To generate the Fibonacci sequence using Sieve of Eratosthenes in Python, we can use the following code:

```
import math

def fibonacci(n):
    if n == 0 or n == 1:
        return [1] + [0]*n
    else:
        primes = []
        sieve = [True for i in range(n)]
        for p in range(2, int(math.sqrt(n))):
            if sieve[p]:
                primes.append(p)
                for i in range(p*p, n+1, p):
                    sieve[i] = False
        return [sum([fibonacci(p)[-2:] for p in primes if n%p==0])[-1]] + [0]*n
```

To use this function and print the first 10 Fibonacci numbers, you can call it like so:

```
