## Answer (2)

The biggest problem with the above code is that it's hard to see what kind of data structure your array points to. It looks like an object pointer, but we don't know if its a raw pointer or smart-pointer and whether you use dynamic allocation for those objects or not. If you do indeed allocate memory dynamically (i.e. using `new`), then there is no way around calling `delete`.

If your code looks something like this:

```
class CMyClass { ... }; //your data structure, e.g. some struct with a few int members and member functions etc.
void MyFunction(CMyClass **array) {...}
int main() {
  std::vector<CMyClass*> array;
  while (...) {
    CMyClass* p = new CMyClass; //allocate dynamically, i.e. on the heap
    ... do something with p ...
    array.push_back(p); //add to vector
  }
  MyFunction(&array[0]); //pass first element of the vector (i.e. a pointer)
  delete [] array;       //deallocate dynamically allocated memory pointed to by all elements in the vector!
}
```

then your code is fine, and you don't need any further calls to `delete`. You have deleted everything properly. However if what I wrote above does not match your application then its probably a good idea to use smart pointers instead of raw pointers. Then you can get rid of the manual memory management altogether:

```
std::vector< std::shared_ptr<CMyClass> > array; //your data structure, e.g. some struct with a few int members and member functions etc.
void MyFunction(std::vector< std::shared_ptr<CMyClass> > &array) {...}
int main() {
  while (...) {
    auto p = std::make_shared<CMyClass>(); //create smart-pointer pointing to an object allocated on the heap. Don't use 'new'.
    ... do something with p ...
    array.push_back(p); //add to vector
  }
  MyFunction(&array[0]);
}
```

Here, when `main()` returns all memory is automatically cleaned up and you don't need any manual deletion at all (which means no chance of leaking). Of course for that to work we assumed the code in your function does not take ownership over those objects pointed by the vector elements. If it did then you would have a problem if the function still holds onto these pointers after main has returned, but thats probably an exception rather than a rule...

