 To demonstrate dynamic memory allocation and deallocation, we will create a class called "ArrayHandler". The class has two methods: one for allocating an array dynamically and filling it with numbers, and another to deallocate the memory properly when we're done using the array. Here's the code for this program:

```c++
#include <iostream>
using namespace std;

class ArrayHandler {
private:
    int *arr;
    unsigned int size;

public:
    // Constructor to allocate memory dynamically and initialize array
    ArrayHandler(unsigned int s) {
        arr = new int[s];
        size = s;
    }

    // Destructor to deallocate the memory when we're done using the array
    ~ArrayHandler() { delete[] arr; }

    void fillArray() {
        for (unsigned int i = 0; i < size; i++) {
            arr[i] = i + 1;
        }
    }

    // Display all elements of the array
    void printArray() {
        cout << "Elements in the array: ";
        for (unsigned int i = 0; i < size; i++) {
            cout << arr[i] << " ";
        }
        cout << endl;
    }
};

int main() {
    ArrayHandler ah(5);   // Create an array with 5 elements
    ah.fillArray();        // Fill the array with numbers from 1 to 5
    ah.printArray();       // Print the contents of the array

    return 0;
}
```
In this program, we declare a class named "ArrayHandler" that has an int array 'arr' and unsigned int variable 'size' as private data members. It has three public methods: constructor, destructor, and additional functions for filling and printing the array. The destructor automatically deallocates the allocated memory when the object is no longer used (i.e., when the object goes out of scope). In main(), we create an instance of ArrayHandler with 5 elements, fill it using the fillArray() method, print the contents of the array, and then the program ends. The destructor will be called automatically to deallocate the memory for the 'arr' pointer.

