#include <iostream>

class ArrayHandler {
public:
    int* allocateArray(int size) {
        arr = new int[size];
        return arr;
    }

    void fillArray(int size) {
        for (int i = 0; i < size; ++i)
            arr[i] = i + 1;
    }

    void deallocateArray() {
        delete[] arr;
        arr = nullptr;
    }

private:
    int* arr = nullptr;
};

int main() {
    ArrayHandler handler;
    int arraySize = 5;

    handler.allocateArray(arraySize);
    handler.fillArray(arraySize);

    std::cout << "Array elements: ";
    for (int i = 0; i < arraySize; ++i)
        std::cout << handler.arr[i] << ' ';
    std::cout << '\n';

    handler.deallocateArray();
    return 0;
}
```

